    .snackbar {
      visibility: hidden;
      /* Hidden by default. Visible on click */
      min-width: 250px;
      /* Set a default minimum width */
      margin-left: -125px;
      /* Divide value of min-width by 2 */
      background-color: var(--bs-alert-bg);
      /* Black background color */
      color: var(--bs-alert-color);
      /* White text color */
      text-align: center;
      /* Centered text */
      border-radius: 2px;
      /* Rounded borders */
      padding: 16px;
      /* Padding */
      position: fixed;
      /* Sit on top of the screen */
      z-index: 1;
      /* Add a z-index if needed */
      left: 50%;
      /* Center the snackbar */
      bottom: 30px;
      /* 30px from the bottom */
    }

    /* Show the snackbar when clicking on a button (class added with JavaScript) */
    .snackbar.show {
      visibility: visible;
      /* Show the snackbar */
      /* Add animation: Take 0.5 seconds to fade in and out the snackbar.
  However, delay the fade out process for 2.5 seconds */
      animation: fadein 0.5s, fadeout 0.5s 2.5s;
    }

    /* Animations to fade the snackbar in and out */

    @keyframes fadein {
      from {
        bottom: 0;
        opacity: 0;
      }

      to {
        bottom: 30px;
        opacity: 1;
      }
    }

    @keyframes fadeout {
      from {
        bottom: 30px;
        opacity: 1;
      }

      to {
        bottom: 0;
        opacity: 0;
      }
    }

    }

    @keyframes burst {
      0% {
        transform: scale(1);
        opacity: 1
      }

      90% {
        transform: scale(1.5);
        opacity: 0
      }
    }

    @keyframes flashing {
      0% {
        opacity: 1
      }

      45% {
        opacity: 0
      }

      90% {
        opacity: 1
      }
    }

    @keyframes fade-left {
      0% {
        transform: translateX(0);
        opacity: 1
      }

      75% {
        transform: translateX(-20px);
        opacity: 0
      }
    }

    @keyframes fade-right {
      0% {
        transform: translateX(0);
        opacity: 1
      }

      75% {
        transform: translateX(20px);
        opacity: 0
      }
    }

    @keyframes fade-up {
      0% {
        transform: translateY(0);
        opacity: 1
      }

      75% {
        transform: translateY(-20px);
        opacity: 0
      }
    }

    @keyframes fade-down {
      0% {
        transform: translateY(0);
        opacity: 1
      }

      75% {
        transform: translateY(20px);
        opacity: 0
      }
    }

    @keyframes tada {
      from {
        transform: scale3d(1, 1, 1)
      }

      10%,
      20% {
        transform: scale3d(.95, .95, .95) rotate3d(0, 0, 1, -10deg)
      }

      30%,
      50%,
      70%,
      90% {
        transform: scale3d(1, 1, 1) rotate3d(0, 0, 1, 10deg)
      }

      40%,
      60%,
      80% {
        transform: rotate3d(0, 0, 1, -10deg)
      }

      to {
        transform: scale3d(1, 1, 1)
      }
    }

    }

    .glightbox-clean .gclose path,
    .glightbox-clean .gnext path,
    .glightbox-clean .gprev path {
      fill: #fff
    }

    .glightbox-clean .gprev {
      position: absolute;
      top: -100%;
      left: 30px;
      width: 40px;
      height: 50px
    }

    .glightbox-clean .gnext {
      position: absolute;
      top: -100%;
      right: 30px;
      width: 40px;
      height: 50px
    }

    .glightbox-clean .gclose {
      width: 35px;
      height: 35px;
      top: 15px;
      right: 10px;
      position: absolute
    }

    .glightbox-clean .gclose svg {
      width: 18px;
      height: auto
    }

    .glightbox-clean .gclose:hover {
      opacity: 1
    }

    .gfadeIn {
      animation: gfadeIn .5s ease
    }

    .gfadeOut {
      animation: gfadeOut .5s ease
    }

    .gslideOutLeft {
      animation: gslideOutLeft .3s ease
    }

    .gslideInLeft {
      animation: gslideInLeft .3s ease
    }

    .gslideOutRight {
      animation: gslideOutRight .3s ease
    }

    .gslideInRight {
      animation: gslideInRight .3s ease
    }

    .gzoomIn {
      animation: gzoomIn .5s ease
    }

    .gzoomOut {
      animation: gzoomOut .5s ease
    }

    @keyframes lightboxLoader {
      0% {
        transform: rotate(0)
      }

      100% {
        transform: rotate(360deg)
      }
    }

    @keyframes gfadeIn {
      from {
        opacity: 0
      }

      to {
        opacity: 1
      }
    }

    @keyframes gfadeOut {
      from {
        opacity: 1
      }

      to {
        opacity: 0
      }
    }

    @keyframes gslideInLeft {
      from {
        opacity: 0;
        transform: translate3d(-60%, 0, 0)
      }

      to {
        visibility: visible;
        transform: translate3d(0, 0, 0);
        opacity: 1
      }
    }

    @keyframes gslideOutLeft {
      from {
        opacity: 1;
        visibility: visible;
        transform: translate3d(0, 0, 0)
      }

      to {
        transform: translate3d(-60%, 0, 0);
        opacity: 0;
        visibility: hidden
      }
    }

    @keyframes gslideInRight {
      from {
        opacity: 0;
        visibility: visible;
        transform: translate3d(60%, 0, 0)
      }

      to {
        transform: translate3d(0, 0, 0);
        opacity: 1
      }
    }

    @keyframes gslideOutRight {
      from {
        opacity: 1;
        visibility: visible;
        transform: translate3d(0, 0, 0)
      }

      to {
        transform: translate3d(60%, 0, 0);
        opacity: 0
      }
    }

    @keyframes gzoomIn {
      from {
        opacity: 0;
        transform: scale3d(.3, .3, .3)
      }

      to {
        opacity: 1
      }
    }

    @keyframes gzoomOut {
      from {
        opacity: 1
      }

      50% {
        opacity: 0;
        transform: scale3d(.3, .3, .3)
      }

      to {
        opacity: 0
      }
    }

      .glightbox-container .ginner-container.desc-top .gslide-image img {
        order: 1
      }

      .glightbox-container .ginner-container.desc-left .gslide-description {
        order: 0
      }

      .glightbox-container .ginner-container.desc-left .gslide-image {
        order: 1
      }

      .gslide-image img {
        max-height: 97vh;

      }

      .gslide-image img.zoomable {

      }

      .zoomed .gslide-image img.zoomable {
        cursor: grab
      }

      .gslide-inline {
        max-height: 95vh
      }

      .gslide-external {
        max-height: 100vh
      }

      .gslide-description.description-left,
      .gslide-description.description-right {
        max-width: 275px
      }

      .glightbox-open {
        height: auto
      }

      .goverlay {
        background: rgba(0, 0, 0, .92)
      }

      .glightbox-clean .gslide-media {

      .glightbox-clean .description-left .gdesc-inner,

        position: absolute;

      }

      .glightbox-clean .gclose,
      .glightbox-clean .gnext,
      .glightbox-clean .gprev {
        background-color: rgba(0, 0, 0, .32)
      }

      .glightbox-clean .gclose:hover,
      .glightbox-clean .gnext:hover,
      .glightbox-clean .gprev:hover {
        background-color: rgba(0, 0, 0, .7)
      }

      .glightbox-clean .gprev {
        top: 45%
      }

      .glightbox-clean .gnext {
        top: 45%
      }

        opacity: .7;
        right: 20px
      }

        background: #000

      box-sizing: content-box
    }

      width: 100%;
      height: 100%;
      position: relative;
      transition-property: transform
    }

      visibility: hidden
    }

    .swiper-autoheight,
    .swiper-autoheight .swiper-slide {

    }

      align-items: flex-start;
      transition-property: transform, height
    }

# Navigation Menu
--------------------------------------------------------------*/
    /**
* Desktop Navigation 
*/
    .navbar {
      padding: 0;
    }

    .navbar ul {
      margin: 0;
      padding: 0;
      display: flex;
      list-style: none;
      align-items: center;
    }

    .navbar li {
      position: relative;
    }

    .navbar>ul>li {
      white-space: nowrap;
      padding: 10px 0 10px 28px;
    }

    .navbar a,
    .navbar a:focus {
      display: flex;
      align-items: center;
      justify-content: space-between;
      padding: 0 3px;
      font-size: 15px;
      font-weight: 600;
      color: #222222;
      white-space: nowrap;
      transition: 0.3s;
      position: relative;
    }

    .navbar a i,
    .navbar a:focus i {
      font-size: 12px;
      line-height: 0;
      margin-left: 5px;
    }

    .navbar>ul>li>a:before {
      content: "";
      position: absolute;
      width: 100%;
      height: 2px;
      bottom: -6px;
      left: 0;
      background-color: #106eea;
      visibility: hidden;
      width: 0px;
      transition: all 0.3s ease-in-out 0s;
    }

    .navbar a:hover:before,
    .navbar li:hover>a:before,
    .navbar .active:before {
      visibility: visible;
      width: 100%;
    }

    .navbar a:hover,
    .navbar .active,
    .navbar .active:focus,
    .navbar li:hover>a {
      color: #106eea;
    }

    .navbar .dropdown ul {
      display: block;
      position: absolute;
      left: 28px;
      top: calc(100% + 30px);
      margin: 0;
      padding: 10px 0;
      z-index: 99;
      opacity: 0;
      visibility: hidden;
      background: #fff;
      box-shadow: 0px 0px 30px rgba(127, 137, 161, 0.25);
      transition: 0.3s;
    }

    .navbar .dropdown ul li {
      min-width: 200px;
    }

    .navbar .dropdown ul a {
      padding: 10px 20px;
      font-weight: 400;
    }

    .navbar .dropdown ul a i {
      font-size: 12px;
    }

    .navbar .dropdown ul a:hover,
    .navbar .dropdown ul .active:hover,
    .navbar .dropdown ul li:hover>a {
      color: #106eea;
    }

    .navbar .dropdown:hover>ul {
      opacity: 1;
      top: 100%;
      visibility: visible;
    }

    .navbar .dropdown .dropdown ul {
      top: 0;
      left: calc(100% - 30px);
      visibility: hidden;
    }

    .navbar .dropdown .dropdown:hover>ul {
      opacity: 1;
      top: 0;
      left: 100%;
      visibility: visible;
    }

    @media (max-width: 1366px) {
      .navbar .dropdown .dropdown ul {
        left: -90%;
      }

      .navbar .dropdown .dropdown:hover>ul {
        left: -100%;
      }
    }

    /**
* Mobile Navigation 
*/
    .mobile-nav-toggle {
      color: #222222;
      font-size: 28px;
      cursor: pointer;
      display: none;
      line-height: 0;
      transition: 0.5s;
    }

    .mobile-nav-toggle.bi-x {

    @media (max-width: 991px) {
      .mobile-nav-toggle {
        display: block;
      }

      .navbar ul {
        display: none;
      }
    }

    .navbar-mobile {
      position: fixed;
      overflow: hidden;
      top: 0;
      right: 0;
      left: 0;
      bottom: 0;
      background: rgba(9, 9, 9, 0.9);
      transition: 0.3s;
      z-index: 999;
    }

    .navbar-mobile .mobile-nav-toggle {
      position: absolute;
      top: 15px;
      right: 15px;
    }

    .navbar-mobile ul {
      display: block;
      position: absolute;
      top: 55px;
      right: 15px;
      bottom: 15px;
      left: 15px;
      padding: 10px 0;
      background-color: #fff;
      overflow-y: auto;
      transition: 0.3s;
    }

    .navbar-mobile a,
    .navbar-mobile a:focus {
      padding: 10px 20px;
      font-size: 15px;
      color: #222222;
    }

    .navbar-mobile>ul>li {
      padding: 0;
    }

    .navbar-mobile a:hover:before,
    .navbar-mobile li:hover>a:before,
    .navbar-mobile .active:before {
      visibility: hidden;
    }

    .navbar-mobile a:hover,
    .navbar-mobile .active,
    .navbar-mobile li:hover>a {
      color: #106eea;
    }

    .navbar-mobile .getstarted,
    .navbar-mobile .getstarted:focus {
      margin: 15px;
    }

    .navbar-mobile .dropdown ul {
      position: static;
      display: none;
      margin: 10px 20px;
      padding: 10px 0;
      z-index: 99;
      opacity: 1;
      visibility: visible;
      background: #fff;
      box-shadow: 0px 0px 30px rgba(127, 137, 161, 0.25);
    }

    .navbar-mobile .dropdown ul li {
      min-width: 200px;
    }

    .navbar-mobile .dropdown ul a {
      padding: 10px 20px;
    }

    .navbar-mobile .dropdown ul a i {
      font-size: 12px;
    }

    .navbar-mobile .dropdown ul a:hover,
    .navbar-mobile .dropdown ul .active:hover,
    .navbar-mobile .dropdown ul li:hover>a {
      color: #106eea;
    }

    .navbar-mobile .dropdown>.dropdown-active {
      display: block;
    }

      width: 12px;
      height: 12px;
      background-color: #fff;
      opacity: 1;
      border: 1px solid #106eea;
    }

    .portfolio-details .portfolio-details-slider .swiper-pagination .swiper-pagination-bullet-active {
      background-color: #106eea;
    }

    .portfolio-details .portfolio-info {
      padding: 30px;
      box-shadow: 0px 0 30px rgba(34, 34, 34, 0.08);
    }

    .portfolio-details .portfolio-info h3 {
      font-size: 22px;
      font-weight: 700;
      margin-bottom: 20px;
      padding-bottom: 20px;
      border-bottom: 1px solid #eee;
    }

    .portfolio-details .portfolio-info ul {
      list-style: none;
      padding: 0;
      font-size: 15px;
    }

    .portfolio-details .portfolio-info ul li+li {
      margin-top: 10px;
    }

    .portfolio-details .portfolio-description {
      padding-top: 30px;
    }

    .portfolio-details .portfolio-description h2 {
      font-size: 26px;
      font-weight: 700;
      margin-bottom: 20px;
    }

    .portfolio-details .portfolio-description p {
      padding: 0;
    }

    /*--------------------------------------------------------------
# Team
--------------------------------------------------------------*/
    .team {
      padding: 60px 0;
    }

    .team .member {
      margin-bottom: 20px;
      overflow: hidden;
      border-radius: 4px;
      background: #fff;
      box-shadow: 0px 2px 15px rgba(16, 110, 234, 0.15);
    }

    .team .member .member-img {
      position: relative;
      overflow: hidden;
    }

    .team .member .social {
      position: absolute;
      left: 0;
      bottom: 30px;
      right: 0;
      opacity: 0;
      transition: ease-in-out 0.3s;
      text-align: center;
    }

    .team .member .social a {
      transition: color 0.3s;
      color: #222222;
      margin: 0 3px;
      padding-top: 7px;
      border-radius: 4px;
      width: 36px;
      height: 36px;
      background: rgba(16, 110, 234, 0.8);
      display: inline-block;
      transition: ease-in-out 0.3s;
      color: #fff;
    }

    .team .member .social a:hover {
      background: #3b8af2;
    }

    .team .member .social i {
      font-size: 18px;
    }

    .team .member .member-info {
      padding: 25px 15px;
    }

    .team .member .member-info h4 {
      font-weight: 700;
      margin-bottom: 5px;
      font-size: 18px;
      color: #222222;
    }

    .team .member .member-info span {
      display: block;
      font-size: 13px;
      font-weight: 400;
      color: #aaaaaa;
    }

    .team .member .member-info p {
      font-style: italic;
      font-size: 14px;
      line-height: 26px;
      color: #777777;
    }

    .team .member:hover .social {
      opacity: 1;
      bottom: 15px;
    }

    /*--------------------------------------------------------------
# Pricing
--------------------------------------------------------------*/
    .pricing .box {
      padding: 20px;
      background: #fff;
      text-align: center;
      box-shadow: 0px 0px 4px rgba(0, 0, 0, 0.12);
      border-radius: 5px;
      position: relative;
      overflow: hidden;
      margin-bottom: 20px;
    }

    .pricing .box h3 {
      font-weight: 400;
      margin: -20px -20px 20px -20px;
      padding: 20px 15px;
      font-size: 16px;
      font-weight: 600;
      color: #777777;
      background: #f8f8f8;
    }

    .pricing .box h4 {
      font-size: 36px;
      color: #106eea;
      font-weight: 600;
      font-family: "Poppins", sans-serif;
      margin-bottom: 20px;
    }

    .pricing .box h4 sup {
      font-size: 20px;
      top: -15px;
      left: -3px;
    }

    .pricing .box h4 span {
      color: #bababa;
      font-size: 16px;
      font-weight: 300;
    }

    .pricing .box ul {
      padding: 0;
      list-style: none;
      color: #444444;
      text-align: center;
      line-height: 20px;
      font-size: 14px;
    }

    .pricing .box ul li {
      padding-bottom: 16px;
    }

    .pricing .box ul i {
      color: #106eea;
      font-size: 18px;
      padding-right: 4px;
    }

    .pricing .box ul .na {
      color: #ccc;
      text-decoration: line-through;
    }

    .pricing .btn-wrap {
      margin: 20px -20px -20px -20px;
      padding: 20px 15px;
      background: #f8f8f8;
      text-align: center;
    }

    .pricing .btn-buy {
      background: #106eea;
      display: inline-block;
      padding: 8px 35px 10px 35px;
      border-radius: 4px;
      color: #fff;
      transition: none;
      font-size: 14px;
      font-weight: 400;
      font-family: "Roboto", sans-serif;
      font-weight: 600;
      transition: 0.3s;
    }

    .pricing .btn-buy:hover {
      background: #3b8af2;
    }

    .pricing .featured h3 {
      color: #fff;
      background: #106eea;
    }

    .pricing .advanced {
      width: 200px;
      position: absolute;
      top: 18px;
      right: -68px;
      transform: rotate(45deg);
      z-index: 1;
      font-size: 14px;
      padding: 1px 0 3px 0;
      background: #106eea;
      color: #fff;
    }

    .pricing .description {
      font-size: 15px;
      line-height: 28px;
      margin-bottom: 0;
    }

    /*--------------------------------------------------------------
# Frequently Asked Questions
--------------------------------------------------------------*/
    .faq {
      padding: 60px 0;
    }

    .faq .faq-list {
      padding: 0;
      list-style: none;
    }

    .faq .faq-list li {
      border-bottom: 1px solid #d4e5fc;
      margin-bottom: 20px;
      padding-bottom: 20px;
    }

    .faq .faq-list .question {
      display: block;
      position: relative;
      font-family: #106eea;
      font-size: 18px;
      line-height: 24px;
      font-weight: 400;
      padding-left: 25px;
      cursor: pointer;
      color: #0d58ba;
      transition: 0.3s;
    }

    .faq .faq-list i {
      font-size: 16px;
      position: absolute;
      left: 0;
      top: -2px;
    }

    .faq .faq-list p {
      margin-bottom: 0;
      padding: 10px 0 0 25px;
    }

    .faq .faq-list .icon-show {
      display: none;
    }

    .faq .faq-list .collapsed {
      color: black;
    }

    .faq .faq-list .collapsed:hover {
      color: #106eea;
    }

    .faq .faq-list .collapsed .icon-show {
      display: inline-block;
      transition: 0.6s;
    }

    .faq .faq-list .collapsed .icon-close {
      display: none;
      transition: 0.6s;
    }

    /*--------------------------------------------------------------
# Contact
--------------------------------------------------------------*/
    .contact .info-box {
      color: #444444;
      text-align: center;
      box-shadow: 0 0 30px rgba(214, 215, 216, 0.3);
      padding: 20px 0 30px 0;
    }

    .contact .info-box i {
      font-size: 32px;
      color: #106eea;
      border-radius: 50%;
      padding: 8px;
      border: 2px dotted #b3d1fa;
    }

    .contact .info-box h3 {
      font-size: 20px;
      color: #777777;
      font-weight: 700;
      margin: 10px 0;
    }

    .contact .info-box p {
      padding: 0;
      line-height: 24px;
      font-size: 14px;
      margin-bottom: 0;
    }

    .contact .email-form {
      box-shadow: 0 0 30px rgba(214, 215, 216, 0.4);
      padding: 30px;
    }

    .contact .email-form .error-message {
      display: none;
      color: #fff;
      background: #ed3c0d;
      text-align: left;
      padding: 15px;
      font-weight: 600;
    }

    .contact .email-form .error-message br+br {
      margin-top: 25px;
    }

    .contact .email-form .sent-message {
      display: none;
      color: #fff;
      background: #18d26e;
      text-align: center;
      padding: 15px;
      font-weight: 600;
    }

    .contact .email-form .loading {
      display: none;
      background: #fff;
      text-align: center;
      padding: 15px;
    }

    .contact .email-form .loading:before {
      content: "";
      display: inline-block;
      border-radius: 50%;
      width: 24px;
      height: 24px;
      margin: 0 10px -6px 0;
      border: 3px solid #18d26e;
      border-top-color: #eee;
      animation: animate-loading 1s linear infinite;
    }

    .contact .email-form .form-group {
      margin-bottom: 20px;
    }

    .contact .email-form input,
    .contact .email-form textarea {
      border-radius: 0;
      box-shadow: none;
      font-size: 14px;
    }

    .contact .email-form input:focus,
    .contact .email-form textarea:focus {
      border-color: #106eea;
    }

    .contact .email-form input {
      padding: 10px 15px;
    }

    .contact .email-form textarea {
      padding: 12px 15px;
    }

    .contact .email-form button[type=submit] {
      background: #106eea;
      border: 0;
      padding: 10px 30px;
      color: #fff;
      transition: 0.4s;
      border-radius: 4px;
    }

    .contact .email-form button[type=submit]:hover {
      background: #3b8af2;
    }

    @keyframes animate-loading {
      0% {
        transform: rotate(0deg);
      }

      100% {
        transform: rotate(360deg);
      }
    }

    /*--------------------------------------------------------------
# Footer
--------------------------------------------------------------*/
    #footer {
      background: #fff;
      padding: 0;
      color: #444444;
      font-size: 14px;
      background: #f1f6fe;
    }

    #footer .footer-newsletter {
      padding: 50px 0;
      background: #f1f6fe;
      text-align: center;
      font-size: 15px;
    }

    #footer .footer-newsletter h4 {
      font-size: 24px;
      margin: 0 0 20px 0;
      padding: 0;
      line-height: 1;
      font-weight: 600;
    }

    #footer .footer-newsletter form {
      margin-top: 30px;
      background: #fff;
      padding: 6px 10px;
      position: relative;
      border-radius: 4px;
      box-shadow: 0px 2px 15px rgba(0, 0, 0, 0.06);
      text-align: left;
    }

    #footer .footer-newsletter form input[type=email] {
      border: 0;
      padding: 4px 8px;
      width: calc(100% - 100px);
    }

    #footer .footer-newsletter form input[type=submit] {
      position: absolute;
      top: 0;
      right: 0;
      bottom: 0;
      border: 0;
      background: none;
      font-size: 16px;
      padding: 0 20px;
      background: #106eea;
      color: #fff;
      transition: 0.3s;
      border-radius: 0 4px 4px 0;
      box-shadow: 0px 2px 15px rgba(0, 0, 0, 0.1);
    }

    #footer .footer-newsletter form input[type=submit]:hover {
      background: #0d58ba;
    }

    #footer .footer-top {
      padding: 60px 0 30px 0;
      background: #fff;
    }

    #footer .footer-top .footer-contact {
      margin-bottom: 30px;
    }

    #footer .footer-top .footer-contact h3 {
      font-size: 24px;
      margin: 0 0 15px 0;
      padding: 2px 0 2px 0;
      line-height: 1;
      font-weight: 700;
    }

    #footer .footer-top .footer-contact h3 span {
      color: #106eea;
    }

    #footer .footer-top .footer-contact p {
      font-size: 14px;
      line-height: 24px;
      margin-bottom: 0;
      font-family: "Roboto", sans-serif;
      color: #777777;
    }

    #footer .footer-top h4 {
      font-size: 16px;
      font-weight: bold;
      color: #444444;
      position: relative;
      padding-bottom: 12px;
    }

    #footer .footer-top .footer-links {
      margin-bottom: 30px;
    }

    #footer .footer-top .footer-links ul {
      list-style: none;
      padding: 0;
      margin: 0;
    }

    #footer .footer-top .footer-links ul i {
      padding-right: 2px;
      color: #106eea;
      font-size: 18px;
      line-height: 1;
    }

    #footer .footer-top .footer-links ul li {
      padding: 10px 0;
      display: flex;
      align-items: center;
    }

    #footer .footer-top .footer-links ul li:first-child {
      padding-top: 0;
    }

    #footer .footer-top .footer-links ul a {
      color: #777777;
      transition: 0.3s;
      display: inline-block;
      line-height: 1;
    }

    #footer .footer-top .footer-links ul a:hover {
      text-decoration: none;
      color: #106eea;
    }

    #footer .social-links a {
      font-size: 18px;
      display: inline-block;
      background: #106eea;
      color: #fff;
      line-height: 1;
      padding: 8px 0;
      margin-right: 4px;
      border-radius: 4px;
      text-align: center;
      width: 36px;
      height: 36px;
      transition: 0.3s;
    }

    #footer .footer-top .social-links a:hover {
      background: #3b8af2;
      color: #fff;
      text-decoration: none;
    }

    #footer .modify {
      display: flex;
      flex-direction: row;
    }

    #footer .copyright {
      text-align: center;
      float: left;
    }

    #footer .social {
      text-align: center;
      width: 500px;
      margin: 0 auto;
    }

    #footer .social a {
      margin: 0 0.2rem;
    }

    #footer .credits {
      float: right;
      text-align: center;
      font-size: 13px;
      color: #444444;
    }

    @media (max-width: 768px) {

      #footer .copyright,
      #footer .credits {
        float: none;
        text-align: center;
        padding: 2px 0;
      }
    }
